import React, { Component } from 'react'
import {Link} from 'react-router-dom';
import './App.css';
export default class Nav extends Component {
    render() {
        return (
            <nav>
                <ul className="nav-links">
                    <Link  to="/home">
                        <li className="links">
                            Home
                        </li>
                    </Link>
                    <Link to="/login" className="links">
                        <li className="links">
                            Login
                        </li>
                    </Link>       
                 </ul>
            </nav>
        )
    }
}
